import walmartLogo from '../assets/images/Walmart.png';
import logoBig from '../assets/images/logoBig.png';
import { Link } from "react-router-dom";

const HomeComponent = () => {
    return (
        <div className="w-full h-full bg-app-black overflow-auto">
            <div className='ml-10'>
                    <Link to="/home">
                        <img src={walmartLogo} alt='logo' style={{ width: "209px", height: "51px" }} />
                    </Link>
                </div>
        </div>
    )
};

export default HomeComponent;
